import React from 'react';
import uuid from 'uuid';
import queries from 'queries/Empresas.jsx';
import { gql } from 'apollo-boost'

const getEmpresas = gql`${queries.getEmpresas}`;

const item=(props)=>{


const element= props.variables;

  return (

        <tr key={uuid()}>
          <th key={(element._id)} className="text-right">
            {(element.nombre)}
          </th>

          <th key={(element._id)} className="text-right">
            {(element.correo)}
          </th>

          <th key={(element._id)} className="text-right">
            {(element.canton)}
          </th>

          <th key={(element._id)} className="text-right">
            {(element.provincia)}
          </th>
        </tr>


  )
};

export default item;
